[[package]]
name = "argcomplete"
version = "2.0.0"
description = "Bash tab completion for argparse"
category = "main"
optional = false
python-versions = ">=3.6"

[package.dependencies]
importlib-metadata = {version = ">=0.23,<5", markers = "python_version == \"3.6\" or python_version == \"3.7\""}

[package.extras]
test = ["coverage", "flake8", "pexpect", "wheel"]

[[package]]
name = "aws-psycopg2"
version = "1.2.1"
description = "A aws psycopg2 package from psycopg2."
category = "main"
optional = false
python-versions = "*"

[[package]]
name = "boto3"
version = "1.21.32"
description = "The AWS SDK for Python"
category = "main"
optional = false
python-versions = ">= 3.6"

[package.dependencies]
botocore = ">=1.24.32,<1.25.0"
jmespath = ">=0.7.1,<2.0.0"
s3transfer = ">=0.5.0,<0.6.0"

[package.extras]
crt = ["botocore[crt] (>=1.21.0,<2.0a0)"]

[[package]]
name = "boto3-stubs"
version = "1.21.32"
description = "Type annotations for boto3 1.21.32 generated with mypy-boto3-builder 7.5.7"
category = "dev"
optional = false
python-versions = ">=3.6"

[package.dependencies]
botocore-stubs = "*"
mypy-boto3-logs = {version = ">=1.21.0,<1.22.0", optional = true, markers = "extra == \"logs\""}
mypy-boto3-s3 = {version = ">=1.21.0,<1.22.0", optional = true, markers = "extra == \"s3\""}
typing-extensions = ">=4.1.0"

[package.extras]
